import React from 'react'
import PropTypes from 'prop-types'
import Checkbox from 'shared/checkbox'

const CheckboxRounded = props => {
  const { name, type, onChange, selected, disableCheckbox } = props
  return (
    <div className='column is-one-third'>
      <div className='checkbox-button'>
        <div className='checkbox-button__label-text'>
          <p>{name}</p>
          <p>{type}</p>
        </div>
        <Checkbox
          name={name}
          onChange={onChange}
          selected={disableCheckbox || selected}
          disabled={disableCheckbox}
        />
      </div>
    </div>
  )
}

export default CheckboxRounded

CheckboxRounded.propTypes = {
  name: PropTypes.string.isRequired,
  selected: PropTypes.bool.isRequired,
  onChange: PropTypes.func.isRequired,
  type: PropTypes.string,
  disableCheckbox: PropTypes.bool
}

CheckboxRounded.defaultProps = {
  name: '',
  selected: false,
  onChange: () => {},
  type: '',
  disableCheckbox: false
}
